import { createApp } from 'vue'
import App from './App.vue'
import router from './router';
import './assets/styles/tailwind.css';
import './assets/styles/main.css';

window.Kakao.init("d23378ff6b70109a54449af376d2c66c");

createApp(App)
  .use(router)
  .mount('#app');
